//component 폴더는 이름 강제 아님. 이 폴더에 component들 담으면 됨.
import React from "react";
import propTypes from "prop-types";

const AppLayout = ({children}) => {
    return (
        <div>
            <div>공통메뉴</div>
            {children}
        </div>
    );
}

AppLayout.propTypes = {
    children: propTypes.node.isRequired,

};

export default AppLayout;
